  \"2015-01-22T18:12:38.788616\",\n\t\"name\": \"tiger-line-shapefile-2012-series-information-file-for-the-current-topological-faces-area-landma\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation. The Topological Faces / Area Landmark Relationship File (FACESAL.dbf) contains
  a record for eachn               face / area landmark relationship. Face refers
  to the areal (polygon) topological primitives that make up MTDB. A face is bounded
  by one or more edges;n               its boundary includes only the edges that separate
  it from other faces, not any interior edges contained within the area of the face.
  The face to which an               record in the Topological Faces / Area Landmark
  Relationship File (FACESAL.dbf) applies can be determined by linking to the Topological
  Faces Shapefilen               (FACES.shp) on the permanent topological face identifier
  (TFID) attribute. The area landmark to which a record in the Topological Faces /
  Area Landmarkn               Relationship File (FACESAL.dbf) applies can be determined
  by linking to the Area Landmark Shapefile (AREALM.shp) on the area landmark identifier
  (AREAID)n               attribute. A face may be part of multiple area landmarks.
  An area landmark may consist of multiple faces.\",\n\t\"license_title\": null,\n\t\"extras\":
